import { useState, useEffect } from 'react';
import './Style.css';
import './Loading.css';

export const FeedInfo = ({ id }) => {
  const [loading, setLoading] = useState(true);
  const [data, setData] = useState({});

  const API_URL = "http://localhost:5000";

  useEffect(() => {
    async function fetchData() {
      try {
        const response = await fetch(`${API_URL}/api/info/${id}`);
        const jsonData = await response.json();
        setData(jsonData[0].information);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    }
    fetchData();
  }, [id]);

  return (
    <div feed={loading && 'loading'} className='feed-information'>
        <div className='feed-info-details'>
          {!loading && (
            <div>
              <div className='amenities'>
                <h3>Amenities:</h3>
                <ul>
                  {Object.keys(data.amenities).map(amenity => (
                    <li key={amenity}>{amenity}: {data.amenities[amenity] ? 'Yes' : 'No'}</li>
                  ))}
                </ul>
              </div>
              <div className='details'>
                <h3>Details:</h3>
                <p>Agency: {data.details.agency}</p>
                <p>Contact Email: {data.details.contact.email}</p>
                <p>Contact Phone: {data.details.contact.phone}</p>
                <p>Agency Link: <a href={data.details.agencyLink} target='_blank' rel='noopener noreferrer'>{data.details.agencyLink}</a></p>
                <p>House Category: {data.details.houseCategory}</p>
                <p>Vacant: {data.details.vacant ? 'Yes' : 'No'}</p>
                <p>Number of Houses Vacant: {data.details.numberOfHousesVacant}</p>
              </div>
              <div className='rules'>
                <h3>Rules:</h3>
                <ul>
                  {data.rules.map((rule, index) => (
                    <li key={index}>{rule}</li>
                  ))}
                </ul>
              </div>
            </div>
          )}
        </div>
    </div>
  );
};
